package pe.gob.serfor.osutd.sgd.repository.bean.logic.model;

public class Ubigeo {

	private String ubDep;
	private String nodep;
	private String noprv;
	private String nodis;
	private String ambito;
	private String ubprv;
	private String ubdis;
	private String ubloc;

	public Ubigeo() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getUbprv() {
		return ubprv;
	}

	public void setUbprv(String ubprv) {
		this.ubprv = ubprv;
	}

	public String getNodep() {
		return nodep;
	}

	public void setNodep(String nodep) {
		this.nodep = nodep;
	}

	public String getNoprv() {
		return noprv;
	}

	public void setNoprv(String noprv) {
		this.noprv = noprv;
	}

	public String getNodis() {
		return nodis;
	}

	public void setNodis(String nodis) {
		this.nodis = nodis;
	}

	public String getUbdis() {
		return ubdis;
	}

	public void setUbdis(String ubdis) {
		this.ubdis = ubdis;
	}

	public String getUbloc() {
		return ubloc;
	}

	public void setUbloc(String ubloc) {
		this.ubloc = ubloc;
	}

	public String getAmbito() {
		return ambito;
	}

	public void setAmbito(String ambito) {
		this.ambito = ambito;
	}

	public String getUbDep() {
		return ubDep;
	}

	public void setUbDep(String ubDep) {
		this.ubDep = ubDep;
	}

}
